//import ComFilhos from './components/ComFilhos.jsx';
import Card from './components/layout/Card.jsx';


ReactDOM.render(
    <div>
         <Pri />
         <Card></Card>
        <Parametros
         titulo = "Pokémon GO: ingresso do GO Fest terá custo de R$54,90; veja detalhes"
         text = "O primeiro dia do Pokémon GO Fest será das 10h às 20h (horário de Brasília) e os treinadores que comprarem o ingresso devem acessar nesse período para receber a pesquisa especial.
         Durante o período do evento os habitats dos Pokémon irão alterar de acordo com a hora. Os Pokémon que aparecerão na natureza terão os seguintes temas: fogo, água, grama, batalha e amizade. Cada um deles aparecerá por duas vezes no período de dez horas."
        />



  </div>
